import React, { useState } from 'react';

function Header() {
    // const [channel, setChannel] = useState(1);

    return(
        <div>
            <header className="channels">
                {/* Nav tabs */}
                <ul class="nav nav-tabs">
                <li class="nav-item">
                    <a class="nav-link active" data-toggle="tab" href="#chan1">Channel 1</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" data-toggle="tab" href="#chan2">Channel 2</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" data-toggle="tab" href="#chan3">Channel 3</a>
                </li>
                </ul>
            </header>
            <body>
                {/* Tab panes */}
                <div class="tab-content">
                <div class="tab-pane container active" id="chan1"><p className="text-white">chan1</p></div>
                <div class="tab-pane container fade" id="chan2">...</div>
                <div class="tab-pane container fade" id="chan3">...</div>
                </div>
            </body>
        </div>
    );
}

export default Header;
